function SimpleDialog({ open, setOpen, data, loader }) {
  const { html, css } = data || {};
  return (
    <ModalWrapper
      isOpen={open}
      setIsOpen={setOpen}
      onClose={() => setOpen(false)}
      className="sonic-profile-dialog"
    >
      <style dangerouslySetInnerHTML={{ __html: css }} />
      <div className="sonic-profile-wrapper">
        <div dangerouslySetInnerHTML={{ __html: html }} />
        {/* <div className='sonic-profile-btn'>
          <ButtonWrapper>Snapshot</ButtonWrapper>
        </div> */}
      </div>
    </ModalWrapper>
  );
}

