const RenderCreationStationLink = () => {
  const { jsonConfig: CONFIG } = useContext(BrandingContext);
  // console.log("RenderCreationStationLink--", CONFIG);
  return (
    <div
      onClick={() => {
        localStorage.setItem("CSLoggingOut", "false");
        const urlToNavigate = `${process.env.NODE_ENV === "development"
          ? "http://localhost:3098"
          : CONFIG?.CS_BASE_URL
          }?${appendCSUrlParams()}`;
        // console.log("navitemsv2-urlToNavigate::", urlToNavigate);
        window.open(urlToNavigate, "_self");
      }}
      className="nav_div"
      style={{ display: "contents" }}
    >
      <NavItem link="#" dontActivate={true}>
        <FormattedMessage id="navbar.navItems.creationStation"></FormattedMessage>
      </NavItem>
    </div>
  );
};

