const mapStateToProps = (state) => {
  return {
    authentication: state.authentication,
    userMeta: state.userMeta,
  };
};

const mapDispatchToProps = (dispatch) => ({
  setResults: (result) => dispatch(setResults(result)),
  setResultsFor: (query) => dispatch(setResultsFor(query)),
  setSearchState: (search_state) => dispatch(setSearchState(search_state)),
  setTransactionToken: (ttoken) => dispatch(setTransactionToken(ttoken)),
  showError: (msg) => dispatch(showError(msg)),
  showSuccess: (msg) => dispatch(showSuccess(msg)),
});

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(withRouterCompat(NavItemsV2));
